import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  Box,
  Grid,
  Card,
  CardActionArea,
  CardAction,
  CardContent,
  CardMedia,
  Button,
  Typography
} from "@material-ui/core";
import Navbar from "./Navbar";

const useStyles = makeStyles({
  mainContainer: {
    background: "#233",
    height: "100%"
  }
});

const Portfolio = () => {
  return (
    <Box component="div">
      <Navbar />
    </Box>
  );
};

export default Portfolio;
